import React from 'react';
import { List } from 'antd';

const Applications = ({ list }) => {
    return (
        <List 
            className={StyleSheet.articleList}
            rowKey="id"
            dataSource={list}
            renderItem={(item) => (
                <List.Item
                    key={item.id}
                >
                    asdf
                </List.Item>
            )}
        />
    );
};

export default Applications;
